INSERT INTO `wp_posts` VALUES (20, 1, '2019-05-16 21:37:11', '2019-05-16 21:37:11', '[section_title align=\"center\" text=\"Services\"]\n[row]\n[column width=\"6\" width_md=\"3\"]\n[service]\n<h4><img class=\"alignnone size-medium wp-image-31\" src=\"http://localhost/wp-content/uploads/2019/05/front-end-dev-icon-300x288.png\" alt=\"\" width=\"300\" height=\"288\" /></h4>\n<h4>FRONT-END DEVELOPER</h4>\nI like to code things from scratch, and enjoy bringing ideas to life in browser.\n[/service]\n[/column]\n[column width=\"6\" width_md=\"3\"]\n[service]\n<h4><img class=\"alignnone size-medium wp-image-33\" src=\"http://localhost/wp-content/uploads/2019/05/back-end-dev-icon-296x300.png\" alt=\"\" width=\"296\" height=\"300\" /></h4>\n<h4>BACKEND DEVELOPER</h4>\nI am capable of developing backend projects as well as server/database management with Cloud Services.\n[/service]\n[/column]\n[column width=\"6\" width_md=\"3\"]\n[service]\n<h4><img class=\"alignnone size-medium wp-image-34\" src=\"http://localhost/wp-content/uploads/2019/05/1-1-300x288.png\" alt=\"\" width=\"300\" height=\"288\" /></h4>\n<h4>MOBILE APP DEVELOPER</h4>\nI can develop scalable and flexible mobile apps for your services or product marketplace together with management, analysis and maintenance.\n[/service]\n[/column]\n[column width=\"6\" width_md=\"3\"]\n[service]\n<h4><img class=\"alignnone size-medium wp-image-37\" src=\"http://localhost/wp-content/uploads/2019/05/problem-solver-1-300x288.png\" alt=\"\" width=\"300\" height=\"288\" /></h4>\n<h4>PROBLEM SOLVER</h4>\nI have strong project management skills and I\'m can take vague problems and requirements and break them down into steps and solutions.\n[/service]\n[/column]\n[/row]\n[section_title align=\"center\" text=\"Now, let’s turn your business idea into reality\"]\n[row]\n[column width=\"5ths\" width_xs=\"4\"]\n[process]\n\n[icon name=\"pe-7s-chat\"]\n<h4>DISCOVER</h4>\n[/process]\n[/column]\n[column width=\"5ths\" width_xs=\"4\"]\n[process]\