INSERT INTO `wp_posts` VALUES (177, 1, '2019-05-17 17:49:20', '2019-05-17 17:49:20', '[row]\n[column width=\"7\"]\n[event]\n<h2>WORK HISTORY</h2>\n[icon name=\"pe-7s-ribbon\"]\n[/event]\n[event]\n<h3>Dec 2017 - Current</h3>\n<h4>Full-Stack Developer</h4>\n<h5>Upwork Inc.</h5>\nI started beginning my journey as a freelancer on UPWORK platform and available for remote work - if you would like to build something together, get in touch?\n[/event]\n[event]\n<h3>Jun 2012 - Dec 2017</h3>\n<h4>Mobile &amp; Web Developer</h4>\n<h5>Appsolute Media, Greek Capital Management, Sesh .</h5>\nI worked as a Mobile &amp; Web Developer at Appsolute Media for 2 years, Sesh for an year, GCM for 2 years.\n[/event]\n[event]\n<h3>2006</h3>\n<h4>Desktop &amp; Web Developer</h4>\n<h5>Envato Inc.</h5>\nI create usable desktop app components, web interfaces, front end coding stuff and almost anything. But i love what i do.\n[/event]\n[event]\n<h2>EDUCATION</h2>\n[icon name=\"pe-7s-study\"]\n[/event]\n[event]\n<h3>2004</h3>\n<h4>Software Engineering</h4>\n<h5>Zespół Szkół Morskich Świnoujście</h5>\n[/event]\n[button text=\"Download CV\" icon=\"pe-7s-download\" url=\"#\"]\n[/column]\n[column width=\"5\"]\n[section_title align=\"center\" text=\"TESTIMONIALS\"]\n[testimonial]\n<h4><img class=\"alignnone size-full wp-image-182\" src=\"http://localhost/wp-content/uploads/2019/05/alex.jpg\" alt=\"\" width=\"300\" height=\"300\" /></h4>\n<h4>Alexander Libkind</h4>\n<h5>CEO / AppsoluteMedia Inc.</h5>\nWe hired Janusz and co-workers to build an e-commerce system within our platform. They developed an application for iOS &amp; Android. The development &amp; management process was great. The guys excelled at meeting deadlines.\n[/testimonial]\n[testimonial]\n\n<img class=\"alignnone size-medium wp-image-184\" src=\"http://localhost/wp-content/uploads/2019/05/todd-300x300.png\" alt=\"\" width=\"300\" height=\"300\" />\n<h4>Todd Zusman</h4>\n<h5>Developer / Freelancer</h5>\nJanusz was a great co-worker and a friend.\nSince working with him, the client highlights the ease of partnering with them on development projects. He is a professional developer that is dedicated to delivering quality work on time and on budget.\nI would\'t be where i am without his support.\n[/testimonial]\n[testimonial]\n\n<img class=\"alignnone size-medium wp-image-186\" src=\"http://localhost/wp-content/uploads/2019/05/stephan-jacob-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\" />\n<h4>Stephan Jacob</h4>\n<h5>CEO/Sesh.IO</h5>\nThis job he was quite busy, but I plan to continue to work with him on javascript projects as he does great work quickly and for great value when he is available. I highly recommend Janusz for React/React-Native projects ...\n[/testimonial]\n[/column]\n[/row]', 'Resume', '', 'publish', 'closed', 'closed', '', 'resume', '', '', '2019-05-17 18:31:27', '2019-05-17 18:31:27', '', 0, 'http://localhost/?page_id=177', 0, 'page', '', 0);
