n_title align=\"center\" text=\"Design Skills\"]\n[progress_bar text=\"Fireworks\" percent=\"90\"]\n[progress_bar text=\"Photoshop\" percent=\"70\"]\n[progress_bar text=\"Illustrator\" percent=\"50\"]\n[section_title align=\"center\" text=\"TESTIMONIALS\"]\n[testimonial]\n\n<img class=\"alignnone size-full wp-image-263\" src=\"http://localhost/wp-content/uploads/2014/04/testo-01-1.jpg\" alt=\"testo-01\" width=\"128\" height=\"128\">\n<h4>Vincent Wood</h4>\n<h5>CEO / Gravity Inc.</h5>\nHe is a great and hardworking guy. I am so proud of i have him as my asistant. He helped me so much. Also i am so proud of i have him as my asistant. He helped me so much.\n[/testimonial]\n[testimonial]\n\n<img class=\"alignnone size-full wp-image-264\" src=\"http://localhost/wp-content/uploads/2014/04/testo-02-1.jpg\" alt=\"testo-02\" width=\"128\" height=\"128\">\n<h4>Gary Morgan</h4>\n<h5>Chemist / Freelancer</h5>\nHe was a great co-worker and a friend. I would\'t be where i am without his support.\n[/testimonial]\n[testimonial]\n\n<img class=\"alignnone size-full wp-image-265\" src=\"http://localhost/wp-content/uploads/2014/04/testo-03-1.jpg\" alt=\"testo-03\" width=\"128\" height=\"128\">\n<h4>Jason Wilson</h4>\n<h5>Lab Geek / Miami Metro</h5>\nHe is ok. I don\'t really know him. He looks nice.\n[/testimonial]\n[/column]\n[/row]', 'Resume', '', 'inherit', 'closed', 'closed', '', '177-revision-v1', '', '', '2019-05-17 17:49:20', '2019-05-17 17:49:20', '', 177, 'http://localhost/2019/05/17/177-revision-v1/', 0, 'revision', '', 0);
