INSERT INTO `wp_posts` VALUES (231, 1, '2019-05-18 17:01:06', '2019-05-18 17:01:06', '[row]\r\n[column width=\"6\" width_md=\"6\"]\r\n<h4 class=\"project__subtitle\">An on-demand delivery app for home and office moves</h4>\r\n<ul class=\"project__tags tags-list\">\r\n 	<li class=\"tags-list__item\"><span class=\"tags-list__tag\">Transportation</span></li>\r\n 	<li class=\"tags-list__item\"><span class=\"tags-list__tag\">iOS</span></li>\r\n 	<li class=\"tags-list__item\"><span class=\"tags-list__tag\">USA</span></li>\r\n</ul>\r\n<p class=\"project__content\">Brilliant Move Inc. wanted to respond to the change happening in the moving industry. We created three distinct products – apps for customers and delivery teams and an admin panel for managers – that simplified the business processes of this on-demand delivery service.</p>\r\n[/column]\r\n[column width=\"6\" width_md=\"6\"]\r\n\r\n<img class=\"size-full wp-image-235\" src=\"http://172.20.1.71/wp-content/uploads/2019/05/1-3.png\" alt=\"\" width=\"1432\" height=\"1378\" />\r\n\r\n[/column]\r\n[/row]', 'Brilliant Move', 'An on-demand delivery app for home and office moves.', 'publish', 'open', 'closed', '', 'brilliant-move', '', '', '2019-05-18 17:35:26', '2019-05-18 17:35:26', '', 0, 'http://172.20.1.71/?post_type=portfolio&#038;p=231', 0, 'portfolio', '', 0);
